	-- end
	if(dwLevel == self.dwMaxLevel) then
		if(sInfo.dwExp > self[dwLevel+1].dwExp) then
			sInfo.dwExp = self[dwLevel+1].dwExp
		end
	end
	sInfo.dwLevelMaxExp =self[dwLevel+1].dwExp - self[dwLevel].dwExp;
	sInfo.dwLevelCurExp = sInfo.dwExp - self[dwLevel].dwExp;
	if dwLevel ~= sInfo.dwLevel then
		--升级处理
		return dwLevel;
	end; 
	sInfo.dwLevel = dwLevel;
	return 0;
end;
